<html><head><title>Team Analyzer</title>
<style>

body {
    font-family: Arial, sans-serif;
    background-color: #1e1e1e;
    color: #f0f0f0;
    margin: 0;
    padding: 0;
}

.container {
    width: 90%;
    margin: 0 auto;
    padding: 20px;
}

.selection-row {
    display: flex;
    flex-wrap: wrap;
    justify-content: center;
    align-items: center;
    gap: 20px; /* Space between the select elements */
    margin: 20px 0;
}

.selection-row .selection-group {
    display: flex;
    flex-direction: column;
    align-items: center;
}

.selection-row .selection-group h3 {
    margin-bottom: 5px;
}

.player-selection {
    margin: 20px 0;
}

.player-selection h3 {
    text-align: center;
}

.player-grid {
    display: flex;
    flex-wrap: wrap;
    justify-content: center;
}

.player-item {
    width: 120px;
    height: 50px;
    margin: 5px;
    line-height: 50px;
    text-align: center;
    background-color: #555;
    color: #ccc;
    cursor: pointer;
    border-radius: 5px;
    user-select: none;
    font-size: 14px;
    transition: background-color 0.3s, color 0.3s;
}

.player-item.selected {
    background-color: #4a7a4a;
    color: #fff;
}

.player-item.unselected {
    background-color: #555;
    color: #ccc;
}

.timeframe-selection select,
.hero-pool-selection select {
    font-size: 16px;
    padding: 5px;
    border: none;
    border-radius: 4px;
    background-color: #333;
    color: #f0f0f0;
    cursor: pointer;
    width: 200px;
    transition: background-color 0.3s, color 0.3s;
}

.timeframe-selection select:hover,
.hero-pool-selection select:hover {
    background-color: #444;
}

table {
    width: 100%;
    border-collapse: collapse;
    margin: 20px auto;
}

th, td {
    border: 1px solid #555;
    padding: 8px;
    text-align: center;
}

th {
    background-color: #333;
    color: #f0f0f0;
    cursor: pointer;
}

tr:nth-child(even) {
    background-color: #2e2e2e;
}

tr:nth-child(odd) {
    background-color: #262626;
}

.report-timestamp {
    text-align: left;
    font-size: 14px;
    color: #ccc;
    margin: 10px 0;
}

.suggested-bans {
    margin: 20px 0;
}

.suggested-bans h2 {
    text-align: center;
}

.suggested-bans-grid {
    display: flex;
    flex-wrap: wrap;
    justify-content: center;
}

.hero-item {
    position: relative;
    width: 80px;
    margin: 5px;
}

.hero-image {
    width: 100%;
    object-fit: cover;
    height: 80px;
    border-radius: 4px;
}

.hero-name {
    text-align: center;
    margin-top: 5px;
    color: #ccc;
    font-size: 12px;
}

/* Custom Tooltip Styles */
.hero-item .tooltip {
    visibility: hidden;
    background-color: rgba(0, 0, 0, 0.8);
    color: #fff;
    text-align: left;
    padding: 8px;
    border-radius: 6px;
    position: absolute;
    z-index: 10;
    bottom: 100%; /* Position above the hero image */
    left: 50%;
    transform: translateX(-50%);
    white-space: pre-line; /* Allow newline characters */
    width: max-content;
    max-width: 200px;
    box-shadow: 0px 0px 10px rgba(0,0,0,0.5);
}

.hero-item:hover .tooltip {
    visibility: visible;
}

@media (max-width: 600px) {
    .selection-row {
        flex-direction: column;
    }

    .timeframe-selection select,
    .hero-pool-selection select {
        width: 100%;
    }
}

.download-button {
    display: flex;
    justify-content: center;
    margin: 20px 0;
}

.download-button button {
    padding: 10px 20px;
    font-size: 16px;
    background-color: #333;
    color: #f0f0f0;
    border: none;
    border-radius: 4px;
    cursor: pointer;
    transition: background-color 0.3s;
}

.download-button button:hover {
    background-color: #444;
}

.break {
  flex-basis: 100%;
  height: 0;
}

let thresholds = {
    "all_time": 1.9,
    "2_years": 1.7,
    "1_year": 1.6,
    "6_months": 1.5,
    "1_month": 1.4
};
let timeFrameWeights = {
    "1_month": 2,
    "6_months": 4,
    "1_year": 3,
    "2_years": 2,
    "all_time": 1
};
function updateReport() {
    let selectedPlayers = [];
    for (let player of players) {
        let playerDiv = document.getElementById(`player-${player.id}`);
        if (playerDiv.classList.contains("selected")) {
            selectedPlayers.push(player.id);
        }
    }
    let timeFrameSelect = document.getElementById("timeFrameSelect");
    let selectedTimeFrame = timeFrameSelect.value;
    let heroIdsToConsider = [];
    heroIdsToConsider = Object.keys(heroNames);
    let combinedScores = {};
    let suggestedBans = {};
    if (selectedTimeFrame === "combined") {
        for (let heroId of heroIdsToConsider) {
            let totalScore = 0;
            for (let playerId of selectedPlayers) {
                let playerTotalScore = 0;
                let totalWeight = 0;
                for (let tf in timeFrameWeights) {
                    let weight = timeFrameWeights[tf];
                    totalWeight += weight;
                    let playerStats = playerHeroStats[tf][playerId][heroId];
                    if (playerStats && playerStats.score) {
                        let score = playerStats.score;
                        playerTotalScore += weight * score;
                        if (score >= thresholds[tf]) {
                            if (!suggestedBans[heroId]) {
                                suggestedBans[heroId] = [];
                            }
                            suggestedBans[heroId].push({
                                playerId: playerId,
                                playerName: players.find(p => p.id === playerId).name,
                                games: playerStats.games,
                                wins: playerStats.wins,
                                winrate: (playerStats.winrate * 100).toFixed(2)
                            });
                        }
                    }
                }
                totalScore += Math.pow((playerTotalScore / totalWeight), 5) / 6;
            }
            if (totalScore > 0) {
                combinedScores[heroId] = totalScore;
            }
        }
    } else {
        for (let heroId of heroIdsToConsider) {
            let totalScore = 0;
            for (let playerId of selectedPlayers) {
                let playerStats = playerHeroStats[selectedTimeFrame][playerId][heroId];
                if (playerStats && playerStats.score) {
                    let score = playerStats.score;
                    totalScore += score;
                    if (score >= thresholds[selectedTimeFrame]) {
                        if (!suggestedBans[heroId]) {
                            suggestedBans[heroId] = [];
                        }
                        suggestedBans[heroId].push({
                            playerId: playerId,
                            playerName: players.find(p => p.id === playerId).name,
                            games: playerStats.games,
                            wins: playerStats.wins,
                            winrate: (playerStats.winrate * 100).toFixed(2)
                        });
                    }
                }
            }
            combinedScores[heroId] = totalScore;
        }
    }
    let bansGrid = document.getElementById("bansGrid");
    bansGrid.innerHTML = "";
    let bansArray = Object.keys(suggestedBans).sort(function(a, b) { return heroNames[a].localeCompare(heroNames[b]); });
    for (let heroId of bansArray) {
        let heroName = heroNames[heroId];
        let heroDotaName = heroIdToDotaName[heroId];
        let heroImageName = heroDotaName.replace("npc_dota_hero_", "");
        let heroImageUrl = `https://cdn.cloudflare.steamstatic.com/apps/dota2/images/dota_react/heroes/${heroImageName}.png`;
        let heroDiv = document.createElement("div");
        heroDiv.classList.add("hero-item");
        let img = document.createElement("img");
        img.src = heroImageUrl;
        img.alt = heroName;
        img.classList.add("hero-image");
        let tooltipDiv = document.createElement("div");
        tooltipDiv.classList.add("tooltip");
        let tooltipText = "";
        for (let playerStats of suggestedBans[heroId]) {
            let playerName = playerStats.playerName;
            let games = playerStats.games;
            let winrate = playerStats.winrate;
            tooltipText += `${playerName}: ${games} games, ${winrate}% winrate\n`;
        }
        tooltipDiv.textContent = tooltipText.trim();
        let nameDiv = document.createElement("div");
        nameDiv.classList.add("hero-name");
        nameDiv.textContent = heroName;
        heroDiv.appendChild(img);
        heroDiv.appendChild(tooltipDiv);
        heroDiv.appendChild(nameDiv);
        bansGrid.appendChild(heroDiv);
    }
    let heroTableBody = document.getElementById("heroTableBody");
    heroTableBody.innerHTML = "";
    let heroEntries = [];
    for (let heroId in combinedScores) {
        heroEntries.push({heroId: heroId, score: combinedScores[heroId]});
    }
    heroEntries.sort(function(a, b) { return b.score - a.score; });
    for (let entry of heroEntries) {
        let row = heroTableBody.insertRow();
        let cellHero = row.insertCell(0);
        let cellScore = row.insertCell(1);
        cellHero.textContent = heroNames[entry.heroId];
        cellScore.textContent = entry.score.toFixed(4);
    }
}
function generateDownloadJSON() {
    let heroTableBody = document.getElementById("heroTableBody");
    let heroRows = heroTableBody.getElementsByTagName("tr");
    let orderedHeroIds = [];
    for (let row of heroRows) {
        let heroName = row.cells[0].textContent;
        let heroId = Object.keys(heroNames).find(id => heroNames[id] === heroName);
        if (heroId) {
            orderedHeroIds.push(parseInt(heroId));
        }
    }
    let categoryConfig = {
        "category_name": "All Heroes",
        "x_position": 0.0,
        "y_position": 0.0,
        "width": 1000.0,
        "height": 1000.0,
        "hero_ids": orderedHeroIds
    };
    let gridJSON = {
        "version": 3,
        "configs": [
            {
                "config_name": "team_analyzer_grid",
                "categories": [categoryConfig]
            }
        ]
    };
    let jsonString = JSON.stringify(gridJSON, null, 4);
    let blob = new Blob([jsonString], {type: "application/json"});
    let url = URL.createObjectURL(blob);
    let a = document.createElement("a");
    a.href = url;
    a.download = "hero_grid.json";
    document.body.appendChild(a);
    a.click();
    document.body.removeChild(a);
    URL.revokeObjectURL(url);
}

    let playerDiv = event.currentTarget;

        playerDiv.classList.add("unselected");
    } else {
        playerDiv.classList.remove("unselected");
        playerDiv.classList.add("selected");
    }
    updateReport();
}
